select max(cd_contract_material_block) from CONTRACT_MATERIAL_BLOCK
;


select * from CONTRACT_MATERIAL_BLOCK
where cd_produto_sap  in (
'000000000000108173'

)

and cd_centro_expedidor in ('6100');
;


