set ic_ativo = 'N',  CD_USUARIO = 3888,
DH_BLOCK = NULL
where cd_produto_sap in (
'000000000000108173'
)

 and cd_centro_expedidor in ( '6100')
AND CD_CONTRACT_MATERIAL_BLOCK IN 
(4072
);
;

